import React, {useState} from 'react';
import DemoHeader from './components/DemoHeader';
import TabNavigation from './components/TabNavigation';
import SingleAnalysis from './components/SingleAnalysis';
import BatchProcessing from './components/BatchProcessing';
import CourseMapping from './components/CourseMapping';
import './styles/index.css';

function App() {
  const [activeTab, setActiveTab] = useState('single');

  const renderActiveComponent = () => {
    switch (activeTab) {
      case 'single':
        return <SingleAnalysis />;
      case 'batch':
        return <BatchProcessing />;
      case 'mapping':
        return <CourseMapping />;
      default:
        return <SingleAnalysis />;
    }
  };

  return (
    <div style={{ minHeight: '100vh' }}>
      <DemoHeader />

      <div className="container">
        <TabNavigation activeTab={activeTab} setActiveTab={setActiveTab} />

        {renderActiveComponent()}

        {/* Footer */}
        <div className="mt-12 text-center py-8" style={{ borderTop: '1px solid #e5e7eb' }}>
          <p className="text-gray-600">
            <strong>Demo Note:</strong> This is a UI demonstration version. All data and analysis results are simulated for preview purposes.
          </p>
          <p className="text-sm text-gray-600 mt-2">
            For the complete AI analysis system, please refer to the full implementation.
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
